import React from 'react';
import { Grid, Card } from '@material-ui/core';

import Style from './styles';

const Nopage = (props) => {
  const classes = Style();

  return (
    <Grid
	  container
	  direction="row"
	  justify="center"
	  alignItems="center">

	  <Grid item xs={5}>
	  	No existela pagina
	  </Grid>

    </Grid>
  )
}

export default Nopage;
